import React, { useState } from 'react';
import './Contact.css';
import './Chatbot.css';

function Contact() {
  const [isChatOpen, setIsChatOpen] = useState(false);
  const [step, setStep] = useState('main'); // Step: 'main' (categories), 'sub' (questions)
  const [selectedCategory, setSelectedCategory] = useState('');
  const [messages, setMessages] = useState([]);

  // Main categories
  const categories = ['Login', 'Register', 'Password', 'Appointment'];

  // Questions and answers based on categories
  const questions = {
    Login: [
      { question: 'How do I log in?', answer: 'Use your registered email and password to log in.' },
      { question: 'I forgot my login details.', answer: 'Click "Forgot Password" on the login page to recover your credentials.' },
    ],
    Register: [
      { question: 'How do I register?', answer: 'Click the "Register" button on the home page and fill out the form.' },
      { question: 'Why should I register?', answer: 'Registration gives you access to personalized services and appointment bookings.' },
    ],
    Password: [
      { question: 'How do I reset my password?', answer: 'Go to the login page and click "Forgot Password" to reset it.' },
      { question: 'How can I change my password?', answer: 'Log in to your account, go to settings, and select "Change Password".' },
    ],
    Appointment: [
      { question: 'How do I book an appointment?', answer: 'Log in, select a doctor, and choose a time slot to book an appointment.' },
      { question: 'Can I cancel or reschedule my appointment?', answer: 'Yes, you can do this from the "Appointments" section in your account.' },
    ],
  };

  // Toggle the chatbot
  const toggleChat = () => {
    setIsChatOpen(!isChatOpen);
    setStep('main'); // Reset step to main options
    setSelectedCategory('');
    setMessages([]);
  };

  const handleCategoryClick = (category) => {
    setSelectedCategory(category);
    setStep('sub');
    setMessages((prev) => [
      ...prev,
      { sender: 'bot', text: `You selected ${category}. Please choose a question:` },
    ]);
  };

  const handleQuestionClick = (question, answer) => {
    setMessages((prev) => [
      ...prev,
      { sender: 'user', text: question },
      { sender: 'bot', text: answer },
    ]);
  };

  return (
    <div className="contact-container">
      <div className="contact-content">
        <h1>Contact Us</h1>
        <p>
          We are here to assist you with any inquiries or support. Reach out to us anytime!
          You can also contact us via email at <strong>support@edoctor.com</strong>
        </p>

        <button className="chat-toggle-button" onClick={toggleChat}>
          Chat with Us
        </button>
      </div>

      {isChatOpen && (
        <div className="chatbot-container">
          <div className="chatbot-header">
            <h3>Chat with Us</h3>
            <button className="close-button" onClick={toggleChat}>
              âœ–
            </button>
          </div>

          <div className="chatbot-body">
            {step === 'main' && (
              <div className="chatbot-main-options">
                <p>Select a category to get started:</p>
                {categories.map((category) => (
                  <button
                    key={category}
                    className="chat-option-button"
                    onClick={() => handleCategoryClick(category)}
                  >
                    {category}
                  </button>
                ))}
              </div>
            )}

            {step === 'sub' && selectedCategory && (
              <div className="chatbot-sub-options">
                <p>Here are some questions related to {selectedCategory}:</p>
                {questions[selectedCategory].map((q, index) => (
                  <button
                    key={index}
                    className="chat-option-button"
                    onClick={() => handleQuestionClick(q.question, q.answer)}
                  >
                    {q.question}
                  </button>
                ))}
                <button className="back-button" onClick={() => setStep('main')}>
                  Back to Categories
                </button>
              </div>
            )}

            <div className="chatbot-messages">
              {messages.map((message, index) => (
                <div
                  key={index}
                  className={`message ${message.sender === 'bot' ? 'bot-message' : 'user-message'}`}
                >
                  {message.text}
                </div>
              ))}
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default Contact;
